import styled from "styled-components/native";

export const ContainerHeader = styled.View`
  width: 100%;
`;

export const ContainerBack = styled.View`
  position: absolute;

  background: #fff;
  border-radius: 50px;
  justify-content: center;
  align-items: center;
  z-index: 3;
  cursor: pointer;
`;
